Now let's create a linux-topic database for user 'sean'. This user will be granted all privileges on this database, including all its tables. Other than granting all privileges, we could only grant specific privileges, including: CREATE, DROP, DELETE, INSERT, SELECT, UPDATE, and GRANT OPTION. Such privileges may be called operations or functions. They allow MySQL users to use and modify the database: Don't use this exact command, but the syntax of the grant command below is this: grant PRIVILEGE_OPTION on DATABASE.TABLE to 'USER'@'LOCALHOST'; In practice, we do this: mysql> create database linuxdb;
mysql> grant all privileges on linuxdb.* to 'sean'@'localhost';
mysql> show databases;
mysql> \q

