Now, we can start doing MySQL work. We've created a new MySQL user named sean and a new database for sean that is called linuxdb . Let's logout out of the Linux root account and re-login under our regular Linux account, for me that's sean , and create tables and data for our database: $ mysql -u sean -p
mysql> show databases;
mysql> use linuxdb;
mysql> create table distributions -> ( -> id int unsigned not null auto_increment, -> name varchar(150) not null, -> developer varchar(150) not null, -> founded date not null, -> primary key (id) -> );
Query OK, 0 rows affected (0.07 sec) mysql> show tables;
mysql> describe distributions; Congratulations! Now create some records for that table.

